# -*- coding: utf-8 -*-

import os
import time


def retrieve_link(PATH):
    """
    
    :param PATH:
    """
    print("retrieving link") # To remove
    print(str(os.path.exists(PATH + 'recaptcha_data/recaptcha.txt')))
    if os.path.exists(PATH + 'recaptcha_data/recaptcha.txt'):
        myfile = open(PATH + 'recaptcha_data/recaptcha.txt', 'r')
        recaptcha_link = myfile.read()
        myfile.close()
        recaptcha_link = recaptcha_link.replace('\n', '')
    else:
        time.sleep(60)
    print("retrieved link:", recaptcha_link) # To remove
    return recaptcha_link


